(640, 130, 'click', 'var item_type = Fabrik.getBlock(&#039;form_13&#039;).elements.get(&#039;gn_item___item_type&#039;).getValue();\r\n\r\n/* GollyNum ========================= */\r\nvar _gollynum                                   = &#039;group91&#039;;\r\n\r\n/* UOM ========================= */\r\nvar _measure_type = Fabrik.getBlock(&#039;form_13&#039;).elements.get(&#039;gn_item___measurement_type&#039;);\r\nvar _uom                                           = &#039;group80&#039;;\r\nvar _uom_length                              = &#039;group81&#039;;\r\nvar _uom_mass                               = &#039;group82&#039;;\r\nvar _uom_time                                 = &#039;group83&#039;;\r\nvar _uom_electric_current             = &#039;group84&#039;;\r\nvar _uom_temperature                   = &#039;group85&#039;;\r\nvar _uom_luminous_intensity       = &#039;group86&#039;;\r\nvar _uom_amount_of_substance = &#039;group87&#039;;\r\nvar _uom_area                                 = &#039;group88&#039;;\r\nvar _uom_volume                            = &#039;group89&#039;;\r\n\r\n/* Event ========================= */\r\nvar _event                                          = &#039;group94&#039;;\r\n\r\n/* (common) ========================= */\r\nvar _description                                = &#039;group90&#039;;\r\nvar _notes                                          = &#039;group92&#039;;\r\n\r\nfunction hideGroups() {\r\n_measure_type.hide();\r\ndocument.id(_gollynum).hide();\r\ndocument.id(_uom).hide();\r\ndocument.id(_uom_length).hide();\r\ndocument.id(_uom_mass).hide();\r\ndocument.id(_uom_time).hide();\r\ndocument.id(_uom_electric_current).hide();\r\ndocument.id(_uom_temperature).hide();\r\ndocument.id(_uom_luminous_intensity).hide();\r\ndocument.id(_uom_amount_of_substance).hide();\r\ndocument.id(_uom_area).hide();\r\ndocument.id(_uom_volume).hide();\r\ndocument.id(_event).hide();  \r\ndocument.id(_description).hide();  \r\ndocument.id(_notes).hide(); \r\n}\r\n\r\n  switch(item_type) {\r\n    case &#039;GollyNum&#039; : \r\n      hideGroups();\r\n      document.id(_gollynum).show();  \r\n      document.id(_description).show();  \r\n      document.id(_notes).show(); \r\n      break;\r\n    case &#039;Unit Of Measurement&#039; : \r\n      hideGroups();\r\n      _measure_type.show();\r\n      document.id(_uom).show();  \r\n      document.id(_uom_length).show();\r\n      document.id(_uom_mass).show();\r\n      document.id(_uom_time).show();\r\n      document.id(_uom_electric_current).show();\r\n      document.id(_uom_temperature).show();\r\n      document.id(_uom_luminous_intensity).show();\r\n      document.id(_uom_amount_of_substance).show();\r\n      document.id(_uom_area).show();\r\n      document.id(_uom_volume).show();\r\n      document.id(_description).show();  \r\n      document.id(_notes).show(); \r\n      break;\r\n    case &#039;Event&#039; : \r\n      hideGroups();\r\n      document.id(_event).show();  \r\n      document.id(_description).show();  \r\n      document.id(_notes).show(); \r\n      break;\r\n  }\r\n', '{\"js_e_event\":\"\",\"js_e_trigger\":\"fabrik_trigger_group_group79\",\"js_e_condition\":\"\",\"js_e_value\":\"\",\"js_published\":\"1\"}'),
(1196, 218, 'click', 'var form = Fabrik.getBlock(&#039;form_23&#039;);\r\nvar table = &#039;gn_event___&#039;;\r\nvar buttons = table + &#039;type&#039;;\r\n\r\nvar chosen = form.elements.get(buttons).getValue();\r\n\r\nvar choice1 = &#039;Single Date&#039;;\r\nvar choice2 = &#039;Start/End&#039;;\r\nvar choice3 = &#039;Start/Duration&#039;;\r\nvar choice4 = &#039;Duration/End&#039;;\r\nvar choice5 = &#039;Duration&#039;;\r\n\r\nvar group_a = &#039;#group118_tab&#039;;\r\nvar group_b = &#039;#group122_tab&#039;;\r\nvar group_c = &#039;#group121_tab&#039;;\r\n\r\nswitch(chosen) {\r\n   case choice1 :\r\n      jQuery(group_a).show();\r\n      jQuery(group_b).hide();\r\n      jQuery(group_c).hide();\r\n      jQuery(group_a).trigger(&#039;click&#039;);\r\n      break;\r\n\r\n    case choice2 :\r\n      jQuery(group_a).show();\r\n      jQuery(group_b).hide();\r\n      jQuery(group_c).show();\r\n      jQuery(group_a).trigger(&#039;click&#039;);\r\n      break;\r\n\r\n    case choice3 :\r\n      jQuery(group_a).show();\r\n      jQuery(group_b).show();\r\n      jQuery(group_c).hide();\r\n      jQuery(group_a).trigger(&#039;click&#039;);\r\n      break;\r\n\r\n    case choice4 :\r\n      jQuery(group_a).hide();\r\n      jQuery(group_b).show();\r\n      jQuery(group_c).show();\r\n      jQuery(group_b).trigger(&#039;click&#039;);\r\n      break;\r\n\r\n    case choice5 :\r\n      jQuery(group_a).hide();\r\n      jQuery(group_b).show();\r\n      jQuery(group_c).hide();\r\n      jQuery(group_b).trigger(&#039;click&#039;);\r\n      break;\r\n}', '{\"js_e_event\":\"\",\"js_e_trigger\":\"fabrik_trigger_group_group115\",\"js_e_condition\":\"\",\"js_e_value\":\"\",\"js_published\":\"1\"}'),
(1286, 313, 'load', '/* end_division_of_year_choices */\r\nvar form = Fabrik.getBlock(&#039;form_23&#039;);\r\n\r\nvar table    = &#039;gn_event___&#039;;\r\nvar tabStart = &#039;start_&#039;;\r\nvar tabEnd   = &#039;end_&#039;;\r\nvar tab      = tabEnd;\r\nvar baseName = table + tab + &#039;division_of_year&#039;;\r\n\r\nvar types    = baseName + &#039;_types&#039;;\r\nvar choices  = baseName + &#039;_choices&#039;;\r\nvar savers   = baseName + &#039;_saver_&#039;;\r\n\r\nvar type     = form.elements.get(types).getValue();\r\nvar choice   = form.elements.get(choices).getValue();\r\n\r\nvar saver    = (savers + type).toLowerCase();\r\nform.elements.get(saver).update(choice);', '{\"js_e_event\":\"\",\"js_e_trigger\":\"fabrik_trigger_group_group115\",\"js_e_condition\":\"\",\"js_e_value\":\"\",\"js_published\":\"1\"}'),
(1287, 313, 'click', '/* end_division_of_year_choices */\r\nvar form = Fabrik.getBlock(&#039;form_23&#039;);\r\n\r\nvar table    = &#039;gn_event___&#039;;\r\nvar tabStart = &#039;start_&#039;;\r\nvar tabEnd   = &#039;end_&#039;;\r\nvar tab      = tabEnd;\r\nvar baseName = table + tab + &#039;division_of_year&#039;;\r\n\r\nvar types    = baseName + &#039;_types&#039;;\r\nvar choices  = baseName + &#039;_choices&#039;;\r\nvar savers   = baseName + &#039;_saver_&#039;;\r\n\r\nvar type     = form.elements.get(types).getValue();\r\nvar choice   = form.elements.get(choices).getValue();\r\n\r\nvar saver    = (savers + type).toLowerCase();\r\nform.elements.get(saver).update(choice);', '{\"js_e_event\":\"\",\"js_e_trigger\":\"fabrik_trigger_group_group115\",\"js_e_condition\":\"\",\"js_e_value\":\"\",\"js_published\":\"1\"}'),
